import { 
    Link,
    BrowserRouter as Router ,
    Routes,
    Route
} from "react-router-dom";
import React from "react";

const CustomRouter = () => {
    return (<Router> 
        <div>      
         <Link to="/home"/>
        <Link to="/caught"/>
        <Routes>
            <Route path="/home"><div><h2>this is home</h2></div></Route>
            <Route path="/caught">this is caught</Route>

        </Routes>
    </div>
    </Router>)
}

export default CustomRouter;
